import {useState,useEffect} from 'react';
import Products from './Products';
function Mid3() {
    const [students, setStudent]= useState([]);
    const [pending, setPending]=useState(true);  //conditional template

    useEffect(()=>{
        fetch('api/')
        .then((res)=>{return res.json()})
        .then((students)=>{
            setStudent(students)
            setPending(false);
            //console.log(students);
        })
    },[])
    return ( 
        <div>
            {pending && <div>Data is Loading....</div>}     
             {students.map((result)=>(
                 
                     <Products key={result._id}
                     name={result.name}
                     disc={result.disc}
                     price={result.price}
                     />
             ))}
        </div>
     );
}

export default Mid3;
